import { Cookies } from 'react-cookie';
import fetch from 'isomorphic-unfetch';


export default class extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          items: []
        };
      }

    render() {
        return (
            <>
                <ul>
                    {props.shows.map(show => (
                        <a>{show.username}</a>
                    ))}
                </ul>
            </>
        );
    }
}
